import React, { useState, useEffect } from "react";
import axios from "axios";
import { Button, Modal } from "react-bootstrap";

const Services = () => {
  const [categories, setCategories] = useState([]);
  const [selectedCategory, setSelectedCategory] = useState(null);
  const [subcategories, setSubcategories] = useState([]);
  const [showModal, setShowModal] = useState(false);

  useEffect(() => {
    axios.get("http://localhost:5000/api/categories")
      .then(response => {
        setCategories(response.data);
      })
      .catch(error => console.error("Error fetching categories:", error));
  }, []);

  const handleCategoryClick = (category) => {
    setSelectedCategory(category);
    axios.get(`http://localhost:5000/api/subcategories?categoryId=${category._id}`)
      .then(response => {
        setSubcategories(response.data);
        setShowModal(true);
      })
      .catch(error => console.error("Error fetching subcategories:", error));
  };

  return (
    <div className="container mt-4">
      <h2 className="text-center mb-4">Our Services</h2>
      <div className="row">
        {categories.map(category => (
          <div key={category._id} className="col-md-4 mb-3">
            <div className="card p-3 text-center">
              <h4>{category.name}</h4>
              <Button variant="primary" onClick={() => handleCategoryClick(category)}>
                View Services
              </Button>
            </div>
          </div>
        ))}
      </div>

      <Modal show={showModal} onHide={() => setShowModal(false)}>
        <Modal.Header closeButton>
          <Modal.Title>{selectedCategory?.name}</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          {subcategories.length > 0 ? (
            subcategories.map(subcategory => (
              <div key={subcategory._id} className="p-2 border-bottom">
                <h5>{subcategory.name}</h5>
                <p>{subcategory.description}</p>
              </div>
            ))
          ) : (
            <p>No subcategories available for this category.</p>
          )}
        </Modal.Body>
      </Modal>
    </div>
  );
};

export default Services;
